(13, '{\"en\": \"Chamber Dryer\", \"fa\": \"خشک کن اتاقکی\"}', 'khoskkon', '{\"en\": \"This is a batch dryer whose production is independent of unloading. Wet bricks are collected in a fixed location. They are then shaped in a specific manner, and air is circulated within the environment using fans to create uniformity. These dryers are built in various methods, such as single-finger or double-finger, two-chamber or single-chamber. Additionally, they have different humidity control systems and hot air blowers.\\r\\n\\r\\nThe drying time typically ranges from 4 to 48 hours, depending on the type of brick and the structure of the dryer. Due to the large space they occupy, the construction costs of the building, trays, and pallets used in these dryers are quite high. Energy consumption in common market designs is estimated to be between 20 and 30 cubic meters of natural gas per ton of production. Typically, about 5 operators are required to control this dryer.\\r\\n\\r\\nThese dryers operate 24 hours a day, independently of production.\", \"fa\": \"خشک‌کن ناپیوسته‌ای است که تولید آن مستقل از تخلیه انجام می‌شود. خشت‌های تر به‌صورت ثابت در محل جمع‌آوری می‌شوند. سپس با روشی مشخص به آن‌ها فرم داده می‌شود و هوا درون محیط با استفاده از فن‌هایی برای ایجاد یکنواختی به چرخش درمی‌آید. این خشک‌کن‌ها به روش‌های مختلفی ساخته می‌شوند، مانند تک‌فینگره یا دو‌فینگره، جفت‌اتاقک یا تک‌اتاقک. همچنین، سیستم‌های رطوبت‌گیر و دمنده هوای گرم متفاوتی دارند.\\r\\n\\r\\nزمان خشک شدن معمولاً بین ۴ تا ۴۸ ساعت متغیر است و این مدت به نوع آجر و ساختار خشک‌کن بستگی دارد. به دلیل فضای زیادی که اشغال می‌کنند، هزینه ساخت ساختمان، سینی‌ها و پالت‌های مورد استفاده در این خشک‌کن‌ها بسیار بالا است. مصرف انرژی در طراحی‌های رایج بازار بین ۲۰ تا ۳۰ مترمکعب گاز طبیعی به ازای هر تن تولید برآورد می‌شود. برای کنترل این خشک‌کن به‌طور معمول حدود ۵ اپراتور مورد نیاز است.\\r\\n\\r\\nاین خشک‌کن‌ها به‌صورت ۲۴ ساعته و بدون وابستگی به تولید روشن می‌مانند.\"}', 3, 3, 4, 2, 2, 2, '2024-12-06 10:22:25', '2024-12-06 10:22:25'),
(14, '{\"en\": \"Semi-Fast Dryer\", \"fa\": \"خشک کن نیمه سریع\"}', 'khoskkon', '{\"en\": \"The semi-fast brick dryer is an efficient system in production lines that increases productivity by reducing the drying time of raw bricks. It optimizes energy consumption while maintaining product quality, making it an ideal choice for brick manufacturing plants. The design of this dryer is such that it offers production variety and easy maintenance as its key features. This dryer is one of the most cost-effective types of dryers.\", \"fa\": \"خشک‌کن نیمه‌سریع آجر سیستمی کارآمد در خطوط تولید است که با کاهش زمان خشک شدن آجرهای خام، بهره‌وری تولید را افزایش می‌دهد که با مصرف بهینه انرژی و حفظ کیفیت محصول، گزینه‌ای ایده‌آل برای کارخانه‌های تولید آجر است. طراحی این خشک کن به گونه ایست که تنوع تولید و نگهداری آسان از ویژگی های آن می باشد. این خشک کن یکی از مقرون به صرفه ترین انواع خشک کن میباشد\"}', 5, 5, 5, 3, 4, 4, '2024-12-06 10:52:40', '2024-12-06 10:52:40'),
(15, '{\"en\": \"Rapid Dryer\", \"fa\": \"خشک کن سریع\"}', 'khoskkon', '{\"en\": \"The fast brick dryer, utilizing advanced technologies, completes the drying process of raw bricks in the shortest time possible. This high-speed system is an ideal choice for factories seeking to increase production capacity and reduce waiting time.\\r\\n\\r\\nFeatures:\\r\\n\\r\\nSignificant reduction in drying time compared to other methods.\\r\\nUse of intelligent design to minimize energy waste.\\r\\nPreservation of the integrity and quality of bricks during the drying process.\\r\\nThe design and construction of the Borna Goster fast dryer are such that components are made with high reliability and long lifespan, ensuring continuous production without interruptions. This is one of the key features of Borna Goster\'s fast dryers.\\r\\n\\r\\nThe Rapid  dryer is a smart choice for leading manufacturers!\", \"fa\": \"خشک‌کن سریع آجر با بهره‌گیری از فناوری‌های پیشرفته، فرآیند خشک‌شدن آجرهای خام را در کوتاه‌ترین زمان ممکن انجام می‌دهد. این سیستم با سرعت بالا، انتخابی مناسب برای کارخانه‌هایی است که به دنبال افزایش ظرفیت تولید و کاهش زمان انتظار هستند.\\r\\n\\r\\nویژگی‌ها:\\r\\nکاهش چشمگیر زمان خشک‌شدن در مقایسه با سایر روش‌ها.\\r\\n استفاده از طراحی هوشمند برای کاهش هدررفت انرژی.\\r\\n حفظ یکپارچگی و کیفیت آجرها در فرآیند خشک‌شدن.\\r\\nطراحی و ساخت خشک کن سریع برناگستر به گونه ای می باشد که قطعات با ضریب اطمینان بالا و عمر طولانی ساخته شده اند لذا امنیت تولید پیوسته و بدون توقف خط تولید از ویژگی های شاخص خشک کن های سریع برناگستر می باشد.  \\r\\nخشک‌کن سریع، انتخابی هوشمندانه برای تولیدکنندگان پیشرو!\"}', 5, 5, 3, 4, 5, 4, '2024-12-06 10:55:05', '2024-12-06 10:55:05'),
(16, '{\"en\": \"Super-Rapid-Dryer\", \"fa\": \"خشک کن فوق سریع\"}', 'khoskkon', '{\"en\": \"This dryer is one of Borna Goster\'s R&D projects, which will be implemented in 2026. The drying time for this dryer in a laboratory scale is less than 5 minutes. It is expected that the final industrial dryer will dry tiles with high quality in less than ten minutes.\", \"fa\": \"این خشک کن از پروژه های R&Dشرکت برناگستر می باشد که در سال 2026 اجرا خواهد شد ،  زمان خشک این خشک کن در  اشل آزمایشگاهی کمتر از 5 دقیقه می باشد . پیش بینی می شود خشک کن  صنعتی نهایی در زمانی کمتر از ده دقیقه سفال را با کیفیت بالا خشک کند.\"}', 5, 4, 2, 5, 4, 5, '2024-12-06 10:56:30', '2024-12-06 11:27:25'),
(17, '{\"en\": \"Tunnel Dryer\", \"fa\": \"خشک کن تونلی\"}', 'khoskkon', '{\"en\": \"The tunnel dryer is one of the reliable yet traditional methods in the brick industry, and it is a type of semi-continuous dryer. Features:\\r\\n\\r\\nProduct type / High production volume.\\r\\nThe feeding methods for this type of dryer are diverse, and it also has a high initial investment cost.\", \"fa\": \"خشک‌کن تونلی یکی از روش های مطمین درعین حال قدیمی صنعت آجر می باشد که از نوع خشک کن های نیمه پیوسته است. ویژگی : \\r\\nتوع محصول/حجم تولید بالا/\\r\\nروش های تغذیه این نوع خشک کن متنوع می باشد و همچنین  هزینه سرمایه گذاری اولیه بالایی دارد.\"}', 2, 3, 4, 1, 1, 2, '2024-12-06 10:57:44', '2024-12-06 10:57:44'),
(18, '{\"en\": \"Hoffman Kiln\", \"fa\": \"کوره هافمن\"}', 'korepokht', '{\"en\": \"In 1858, Friedrich Hoffman invented this type of kiln for firing various types of bricks, which later found applications in other branches of the ceramics industry. Although this kiln is classified as a continuous kiln, there is a time gap for loading and unloading between consecutive firings. In this kiln, the dry bricks remain stationary, and the heat source moves through the roof of the kiln.\\r\\n\\r\\nThe kiln is manually loaded, and depending on the number of kiln chambers (qamirs), it accommodates different production capacities and spatial arrangements. Hoffman kilns have a higher waste rate compared to tunnel kilns. The firing time in these kilns, depending on the type and quality of the clay used, is a minimum of 24 hour\", \"fa\": \"در سال 1858 توسط فردریش هافمن برای پخت انواع آجرابداع شدکه بعدها از آن در برخی دیگر از زیرشاخه های صنعت سرامیک نیز استفاده شد. گرچه این کوره  در گروه کوره های پیوسته قرار میگیرد ولی  مدت زمانی صرف بارگیری و تخلیه کوره ما بین پخت های متوالی ان ایجاد می گردد. خشت خشک شارژ شده در این کوره ثابت و منبع حرارت از طریق سقف کوره جابجا میگردد. شارژ کوره دستی و با توجه به تعداد اتاقهای کوره (قمیر) فضا و میزان تولید متفاوتی را در بر میگیرد. کوره های هافمن نسبت به کوره های تونلی میزان ضایعات بالاتری را دارا هستند. زمان پخت در این کوره ها با توجه به جنس و نوع خاک مصرفی، حداقل 24 ساعت است.\"}', NULL, NULL, NULL, NULL, NULL, NULL, '2024-12-08 03:30:53', '2024-12-08 03:30:53'),
(19, '{\"en\": \"Tunnel Kilns\", \"fa\": \"کوره های تونلی\"}', 'korepokht', '{\"en\": \"In the early 20th century, tunnel kilns were designed by some German and British companies. Dried bricks are loaded onto wagons and moved through the kiln, passing through thermal zones created by stationary burners. The fired bricks exit from the other end of the kiln.\\r\\n\\r\\nThe approximate dimensions of these kilns vary based on the factory\'s production requirements. With some modifications in size and temperature settings, their use expanded significantly in industries like fine ceramics, pottery, and ceramic tableware.\\r\\n\\r\\nTunnel kilns are known for their ability to reduce energy consumption, labor requirements, and emissions of CO and CO₂. The firing duration in these kilns ranges between 20 and 36 hours, depending on the material and production needs.\", \"fa\": \"در اوایل قرن بیستم توسط برخی شرکتهای آلمانی و انگلیسی طراحی شدند. خشت های خشک شده توسط واگنهایی به داخل آن وارد شده و با گذر از مناطق یا زونهای حرارتی ایجاد شده توسط مشعلهای ثابت، آجر پخته شده از سمت دیگر آن خارج میگردد. ابعاد حدودی این کوره ها با توجه به نیاز و میزان تولید کارخانه متغییر است. با مقداری تغییرات ابعادی و دمایی در این کوره ها استفاده از آنها در برخی صنایع مانند سرامیکهای ظریف، سفالینه ها و ظروف سرامیکی بسیار گسترش پیدا کرد. با استفاده از این کوره میتوان میزان مصرف انرژی، نیروی کار و میزان تولید  COو CO2 را نیز کاهش داد. زمان پخت در این کوره ها بین 20 تا 36 ساعت میباشد.\"}', NULL, NULL, NULL, NULL, NULL, NULL, '2024-12-08 03:34:09', '2024-12-08 03:34:09'),
(20, '{\"en\": \"Fast Firing Kilns\", \"fa\": \"کوره پخت سریع\"}', 'korepokht', '{\"en\": \"For the first time in the country, this organization has designed and built a kiln capable of firing clay bricks in approximately 4 hours. With the innovations and designs implemented, the loading of dried bricks and the unloading of fired bricks can be fully automated.\\r\\n\\r\\nThis kiln introduces new horizons in the realm of rapid brick firing, significantly reducing associated costs while increasing efficiency. Its advanced technology marks a breakthrough in the brick production industry, enabling faster operations and streamlined processes.\", \"fa\": \"که از ابداعات این مجموعه بوده است، برای اولین بار در کشور کوره ای طراحی و ساخته که توانایی پخت آجر سفال را در حدود 4 ساعت را داشته و با تمهیدات و طراحی های صورت گرفته ورود خشت خشک و خروج آجر پخته شده نیز بصورت کاملا اتوماتیک قابل طرح و اجرا میباشد.این کوره افق های جدیدی را در بحث پخت سریع آجر و کاهش هزینه های مرتبط با آن ایجاد نموده است.\"}', NULL, NULL, NULL, NULL, NULL, NULL, '2024-12-08 03:35:27', '2024-12-08 03:35:27');
