(18, '{\"en\": \"Tupac Exhibition, Turkey\", \"fa\": \"نمایشگاه توپاک ترکیه\"}', '{\"en\": \"Borna Gostar Parsian Company participated as a machinery builder in the building industry on 1399/02/20 at the Tupac Exhibition in Turkey.\", \"fa\": \"حضور شرکت برنا گستر پارسی به عنوان ماشین ساز در صنعت ساختمان در تاریخ 1399/02/20 در نمایشگاه توپاک ترکیه.\"}', '{\"en\": \"Exhibition\", \"fa\": \"نمایشگاه\"}', 'posts/NRqZ2U3SIKmnBzEBEwRFBR1AnbxIXYcA9MZ9yHuG.jpg', '2020-09-27 05:54:56', '2020-09-27 05:54:56', NULL),
(19, '{\"en\": \"Visit of OGT Representatives\", \"fa\": \"بازدید نمایندگان شرکت OGT\"}', '{\"en\": \"OGT representatives visited Borna Gostar to evaluate the Glass Wool Tunnel project.\", \"fa\": \"نمایندگان شرکت OGT از شرکت برنا گستر جهت ارزیابی پروژه تونل پشم شیشه بازدید کردند.\"}', '{\"en\": \"Event\", \"fa\": \"رویداد\"}', 'posts/6waL0iUJruIhsasAbwdKygkFHpCPOr1IyMIWDGQF.jpg', '2023-08-27 05:57:51', '2023-08-27 05:57:51', NULL),
(20, '{\"en\": \"Glass Facade Project in Iran Mall\", \"fa\": \"پروژه نمای شیشه در ایران مال\"}', '{\"en\": \"Launching the glass facade project at Iran Mall.\", \"fa\": \"آغاز پروژه نمای شیشه در ایران مال.\"}', '{\"en\": \"Project\", \"fa\": \"پروژه\"}', 'posts/HjZMji4fX6tNkuAwcqrckEmj9o3DfU8N6syhgXkx.jpg', '2022-10-27 06:00:02', '2022-10-27 06:00:02', NULL),
(21, '{\"en\": \"Unveiling of Hi-Tech Fans\", \"fa\": \"رونمایی از فن هایتک\"}', '{\"en\": \"Introducing high-tech fans developed by Borna Gostar.\", \"fa\": \"رونمایی از فن‌های پیشرفته ساخته شده توسط برنا گستر.\"}', '{\"en\": \"Conference\", \"fa\": \"همایش\"}', 'posts/NR3UYHuT5uIGrQNUEsjwqWma5b3VNlBN0GvYhLJs.jpg', '2015-03-27 06:08:42', '2015-03-27 06:08:42', NULL),
(22, '{\"en\": \"Visit to Leading European Companies\", \"fa\": \"بازدید از شرکت‌های معتبر اروپایی\"}', '{\"en\": \"A delegation visited leading European companies for collaboration opportunities.\", \"fa\": \"هیئتی از شرکت‌های معتبر اروپایی بازدید کرد.\"}', '{\"en\": \"Event\", \"fa\": \"رویداد\"}', 'posts/gLuMdLkHn8vk2cesZMM4I7aK9QYuMitqJzOpVmJl.jpg', '2024-07-27 06:13:14', '2024-10-29 22:56:44', NULL),
(23, '{\"en\": \"Launching the First Fast Dryer in Azerbaijan\", \"fa\": \"راه‌اندازی اولین خشک کن سریع در آذربایجان\"}', '{\"en\": \"The first fast dryer in Azerbaijan was launched successfully.\", \"fa\": \"اولین خشک کن سریع در آذربایجان با موفقیت راه‌اندازی شد.\"}', '{\"en\": \"Project\", \"fa\": \"پروژه\"}', 'posts/UpI3OPss98SANTY0ztAz0o6jwNamapr6Y87MYwDv.jpg', '2015-05-27 06:17:47', '2015-05-27 06:17:47', NULL),
(24, '{\"en\": \"VDMA European Machinery Conference\", \"fa\": \"کنفرانس ماشین آلات اروپایی VDMA\"}', '{\"en\": \"The VDMA conference in Isfahan brought together 16 major European machinery manufacturers.\", \"fa\": \"کنفرانس ماشین‌آلات اروپایی VDMA در اصفهان با حضور 16 تولیدکننده برجسته اروپایی برگزار شد.\"}', '{\"en\": \"Conference\", \"fa\": \"کنفرانس\"}', 'posts/vx7niJJSjxSDdGPy3DSC45usnoHTZenqKGa2vCVE.jpg', '2020-10-27 06:19:45', '2020-10-27 06:19:45', NULL),
(25, '{\"en\": \"Construction Industry Exhibition 1393\", \"fa\": \"نمایشگاه صنعت ساختمان 1393\"}', '{\"en\": \"Participation in the 1393 Construction Industry Exhibition.\", \"fa\": \"حضور در نمایشگاه صنعت ساختمان سال 1393.\"}', '{\"en\": \"Exhibition\", \"fa\": \"نمایشگاه\"}', 'posts/HBeT0zx95NIEqgBI9DvLD3mQIZhMcZE0Lg2k0fj7.jpg', '2014-05-27 06:26:32', '2014-05-27 06:26:32', NULL),
(26, '{\"en\": \"Doors and Windows Exhibition 1393\", \"fa\": \"نمایشگاه در و پنجره 1393\"}', '{\"en\": \"Showcasing advanced door and window technology.\", \"fa\": \"نمایش فناوری پیشرفته درب و پنجره.\"}', '{\"en\": \"Exhibition\", \"fa\": \"نمایشگاه\"}', 'posts/nt55inhXhJRqxT71YnXOaivL9xcjhs8OLct3zGIH.jpg', '2014-03-27 06:26:32', '2014-03-27 06:26:32', NULL),
(27, '{\"en\": \"Mazandaran Construction Exhibition\", \"fa\": \"نمایشگاه صنعت ساختمان مازندران\"}', '{\"en\": \"Borna Gostar showcased innovative solutions in the Mazandaran Construction Exhibition.\", \"fa\": \"برنا گستر در نمایشگاه صنعت ساختمان مازندران نوآوری‌های خود را به نمایش گذاشت.\"}', '{\"en\": \"Exhibition\", \"fa\": \"نمایشگاه\"}', 'posts/cVRt43k3PSGKEl0KsfhelG9G0hvChGu5o5rkuY9i.jpg', '2014-10-27 06:26:32', '2014-10-27 06:26:32', NULL);
